sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var tw = inputs.totalWork;
  var mr = inputs.manualRework;

  var score = mr / tw;
  score = score.toFixed(2);

  outputs.score = score;
})(inputs, outputs);

